import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function Details() {
  const { id } = useParams();
  const [meal, setMeal] = useState(null);

  useEffect(() => {
    axios
      .get(`https://www.themealdb.com/api/json/v1/1/lookup.php?i=${id}`)
      .then((res) => setMeal(res.data.meals[0]));
  }, [id]);

  if (!meal) return <p className="text-center mt-5">Loading...</p>;

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        padding: "40px",
        backgroundColor: "#f3f6f9",
        minHeight: "100vh",
      }}
    >
      <div
        style={{
          maxWidth: "900px",
          width: "100%",
          background: "#fff",
          borderRadius: "20px",
          boxShadow: "0 6px 20px rgba(0,0,0,0.1)",
          padding: "30px",
        }}
      >
        {/* Title */}
        <h1
          style={{
            textAlign: "center",
            color: "#2c3e50",
            marginBottom: "20px",
            fontWeight: "700",
          }}
        >
          {meal.strMeal}
        </h1>

        {/* Image */}
        <div style={{ textAlign: "center", marginBottom: "25px" }}>
          <img
            src={meal.strMealThumb}
            alt={meal.strMeal}
            style={{
              borderRadius: "15px",
              maxWidth: "100%",
              boxShadow: "0 4px 15px rgba(0,0,0,0.2)",
            }}
          />
        </div>

        {/* Category & Area */}
        <div style={{ textAlign: "center", marginBottom: "30px" }}>
          <span
            style={{
              background: "#27ae60",
              color: "#fff",
              padding: "8px 15px",
              borderRadius: "25px",
              marginRight: "10px",
              fontWeight: "500",
            }}
          >
            {meal.strCategory}
          </span>
          <span
            style={{
              background: "#f39c12",
              color: "#fff",
              padding: "8px 15px",
              borderRadius: "25px",
              fontWeight: "500",
            }}
          >
            {meal.strArea}
          </span>
        </div>

        {/* Ingredients */}
        <h3 style={{ color: "#34495e", marginBottom: "15px" }}>ðŸ›’ Ingredients</h3>
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(auto-fit, minmax(200px, 1fr))",
            gap: "10px",
            marginBottom: "25px",
          }}
        >
          {Array.from({ length: 20 }).map((_, i) => {
            const ingredient = meal[`strIngredient${i + 1}`];
            const measure = meal[`strMeasure${i + 1}`];
            return ingredient ? (
              <div
                key={i}
                style={{
                  background: "#f8f9fa",
                  padding: "10px",
                  borderRadius: "10px",
                  fontSize: "0.95rem",
                  textAlign: "center",
                  boxShadow: "0 2px 6px rgba(0,0,0,0.05)",
                }}
              >
                {ingredient} <b>- {measure}</b>
              </div>
            ) : null;
          })}
        </div>

        {/* Instructions */}
        <h3 style={{ color: "#34495e", marginBottom: "15px" }}>ðŸ“– Instructions</h3>
        <p
          style={{
            lineHeight: "1.8",
            background: "#fdfdfd",
            padding: "20px",
            borderRadius: "15px",
            boxShadow: "0 2px 8px rgba(0,0,0,0.05)",
            fontSize: "1rem",
          }}
        >
          {meal.strInstructions}
        </p>

        {/* Video */}
        {meal.strYoutube && (
          <div style={{ marginTop: "40px", textAlign: "center" }}>
            <h3 style={{ color: "#34495e", marginBottom: "15px" }}> Video Recipe</h3>
            <iframe
              width="100%"
              height="450"
              src={meal.strYoutube.replace("watch?v=", "embed/")}
              title="YouTube video player"
              frameBorder="0"
              allowFullScreen
              style={{
                borderRadius: "15px",
                boxShadow: "0 4px 15px rgba(0,0,0,0.1)",
              }}
            ></iframe>
          </div>
        )}
      </div>
    </div>
  );
}

export default Details;
